import { title } from "process";
import Header from "../../components/header/Header";
import dataRoutine from "../../helpers/data"

function RoutineDays(){

    let url = window.location.href;
    let lastValueURL = url.split('/').pop();

    return(
        <>
            <Header></Header>
            {dataRoutine.map((routine, idx) => (
                        <a href="" key={idx}>{routine.title = lastValueURL?.toString()}</a>
                    ))}
        </>
    );
}

export default RoutineDays
